        ></img>
        <div>
          <img
            className="astronaut"
            src="http://bm.img.com.ua/berlin/storage/orig/2/e3/c7eb255f1c240407c9a6a205378a2e32.png"
          ></img>
          <div>text</div>
        </div>
        <div>input</div>
      </div>
  );
};

